import React from 'react';
import { Mail, MapPin, User, CheckCircle, Globe } from 'lucide-react';
import { motion } from 'framer-motion';
import styles from './About.module.css';

const About: React.FC = () => {
  return (
    <section id="about" className={styles.about}>
      <div className={styles.container}>
        {/* Profile Section */}
        <motion.div 
          className={styles.profileSection}
          initial={{ opacity: 0, x: -50 }}
          whileInView={{ opacity: 1, x: 0 }}
          transition={{ duration: 0.8, delay: 0.2 }}
          viewport={{ once: true }}
        >
          <div className={styles.profileImage}>
            <User size={120} />
          </div>
        </motion.div>

        {/* Info Section */}
        <motion.div 
          className={styles.infoSection}
          initial={{ opacity: 0, x: 50 }}
          whileInView={{ opacity: 1, x: 0 }}
          transition={{ duration: 0.8, delay: 0.4 }}
          viewport={{ once: true }}
        >
          <motion.h1 
            className={styles.name}
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.6 }}
            viewport={{ once: true }}
          >
            Hüseyin Koç
          </motion.h1>
          
          <motion.h2 
            className={styles.title}
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.7 }}
            viewport={{ once: true }}
          >
            Computer Engineering Student
          </motion.h2>
          
          <motion.div 
            className={styles.location}
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.8 }}
            viewport={{ once: true }}
          >
            <MapPin size={18} />
            <span>Izmir, Turkey</span>
          </motion.div>
          
          <motion.a 
            href="mailto:kochuseyin@hotmail.fr"
            className={styles.email}
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.9 }}
            viewport={{ once: true }}
            whileHover={{ scale: 1.05 }}
          >
            <Mail size={18} />
            <span>kochuseyin@hotmail.fr</span>
          </motion.a>
          
          <motion.p 
            className={styles.description}
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 1.0 }}
            viewport={{ once: true }}
          >
            I am a computer engineering student at Ege University, passionate about technology and the world of computers. I am constantly striving to improve myself and make the most of the opportunities technology offers. My career goal is to specialize in software development and produce innovative solutions. I am committed to continuous learning and self-improvement, aiming to play an important role in the tech world in the future.
          </motion.p>
          
          <motion.div 
            className={styles.skills}
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 1.1 }}
            viewport={{ once: true }}
          >
            <h3 className={styles.skillsTitle}>
              <CheckCircle size={20} style={{ marginRight: '8px' }} />
              Technical Skills
            </h3>
            <div className={styles.skillsList}>
              {['Python', 'C#', 'Java', 'MySQL', 'ASP.NET MVC', 'PL/SQL', 'Oracle DB'].map((skill, index) => (
                <motion.span 
                  key={skill}
                  className={styles.skill}
                  initial={{ opacity: 0, scale: 0.8 }}
                  whileInView={{ opacity: 1, scale: 1 }}
                  transition={{ duration: 0.4, delay: 1.2 + index * 0.1 }}
                  viewport={{ once: true }}
                  whileHover={{ scale: 1.1 }}
                >
                  {skill}
                </motion.span>
              ))}
            </div>
          </motion.div>
          
          <motion.div 
            className={styles.languages}
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 1.3 }}
            viewport={{ once: true }}
          >
            <h3 className={styles.languagesTitle}>
              <Globe size={20} style={{ marginRight: '8px' }} />
              Languages
            </h3>
            <div className={styles.languageList}>
              {['Turkish', 'French (native)', 'English (B1-B2)'].map((language, index) => (
                <motion.span 
                  key={language}
                  className={styles.language}
                  initial={{ opacity: 0, scale: 0.8 }}
                  whileInView={{ opacity: 1, scale: 1 }}
                  transition={{ duration: 0.4, delay: 1.4 + index * 0.1 }}
                  viewport={{ once: true }}
                  whileHover={{ scale: 1.1 }}
                >
                  {language}
                </motion.span>
              ))}
            </div>
          </motion.div>
        </motion.div>
      </div>
    </section>
  );
};

export default About;
